import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import { Navbar } from './Navbar';
import {Login} from './Login'


function App() {
    return (
        <BrowserRouter>
        <Navbar isAuthenticated={true}/>
            <Routes>
                <Route path="/login" element={<Login/>}/>
            </Routes>
        </BrowserRouter>
    );
}

export default App;
